import React from 'react';

const HousingList = ({ houses }) => (
  <div>
    <h3>Filtered Houses</h3>
    {houses.map((house, index) => (
      <div key={index}>
        <p>{house.name}</p>
        <p>{house.description}</p>
      </div>
    ))}
  </div>
);
export default HousingList;
